import React from "react";
import 'bootstrap/dist/css/bootstrap.css';
import 'bootstrap/dist/js/bootstrap.bundle';

class Libera_Ui extends React.Component {
    state = { 

     } 
    render() { 
        return (
        <div className="main">    
           <div className="header-page">
                <div className="header-text">
                    <h1>The world's first Triple passive income & Hyper Deflationary token listed on Centralized Exchanges (CEXes)</h1>
                    <h3>The next Break Through in Defi space by Libero Financial - an innovation enabling the 4,037.20% Fixed APY token to be Hyper Deflationary</h3>
                </div>
                <div className="row mt-5">
                    <div className="col-lg-6 gift">
                        <center><img style={{width:"90%",height:'100%'}} src="/images/gift.webp"/></center>
                    </div>
                    <div className="col-lg-6 order-lg-2 order-first">
                        <div className="w-100 bg-dark mt-1 col-card">
                            
                            <img style={{width:"10%",height:'9%'}} className="ms-1 mt-1"  src="/images/minilogo.png"/>
                            <div className="d-inline-block align-text-top">
                                <h4 className="text-white ">LIBERA Price</h4>
                                <h5 className="text-white ms-5 pb-3">$1.581</h5>
                            </div>
                        </div>
                    </div>

                </div>
           </div>
         </div>
        );
    }
}
 
export default Libera_Ui;
